import React, { Component } from "react";
import Particles from 'react-particles-js';
import logo from './img.jpg'

const particleOpt = {
 particles: {
                  numbers :{
                      value : 150 ,
                      density: {
                          enable : true,
                          value_area : 800
                      }
                  }
              }
}

class Bg extends Component {
  render() {
    return (
        <Particles 
        params={ particleOpt
             
          }
        style={{
       
          backgroundImage: `url(${logo})` 
        }}
      />
    );
  }
}

export default Bg;
